// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // 필요한 모듈 import
import Header from './components/Header';
import Footer from './components/Footer';
import MainRoutes from './routes/MainRoutes';
import CommunityPage from './pages/CommunityPage';
import GominDetailPage from './pages/GominDetailPage';
import InfoDetailPage from './pages/InfoDetailPage';
import WritePage from './pages/WritePage';
import NotFoundPage from './pages/NotFoundPage';


function App() {
  return (
    <Router>
      <div className="app-container">
        <Header />
        <main className="content">
            <Route path="/" element={<MainRoutes />} /> {/* 메인 라우트 */}
            <Route path="/community" element={<CommunityPage />} />
            <Route path="/community/gomin/:category" element={<GominDetailPage />} />
            <Route path="/community/info/:category" element={<InfoDetailPage />} />
            <Route path="/community/write" element={<WritePage />} />
            <Route path="*" element={<NotFoundPage />} /> {/* 404 페이지 */}
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
